  \"2013-03-14T19:25:25.117727\",\n\t\"name\": \"beach-profile-locations\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Beaches are commonly characterized by cross-shore
  surveys. The resulting profiles represent the elevation of the beach surface and
  nearshore seabed from the back of the beach to beyond the closure depth. The profile
  data show seasonal and long-term elevation changes in the beach and nearshore zone.
  These beach profile data provide information pertaining to the historic and existing
  sand volumes, beach elevations, and shoreline positions that are useful for planning
  and design.SANDAG has recorded beach profiles throughout the Coastal RSM Plan area
  since 1995, and the USACE recorded profiles from 1934 to 1989. North and South County
  profile locations are shown in Figures 9 and 10, respectively. Profiles are presently
  recorded in April/May to measure post-winter conditions and in October to measure
  post-summer conditions. The beach profiles are used to assess seasonal changes in
  sand movement on- and offshore, shoreline position, beach retreat or advance, and
  closure depth. The latest profiles are assumed to represent existing conditions
  at each sand placement site.Beach Profile data collected along the coastline of
  San Diego County during the period of 1996 through 2004 is available via a ZIP file
  from here: http://www.sandag.org/index.asp?projectid=101=projects.detail This dataset
  was submitted to CSMW by SANDAG as part of the San Diego County Coastal Regional
  Sediment Management Plan (2009).\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
